{"Confirmation": "Επικοινωνία: eokal@espiv.net, buenavista_kal@espiv.net", "Link": "https://www.facebook.com/%CE%9F%CE%BC%CE%AC%CE%B4%CE%B1-%CE%91%CE%BB%CE%BB%CE%B7%CE%BB%CE%BF%CE%B2%CE%BF%CE%AE%CE%B8%CE%B5%CE%B9%CE%B1%CF%82-%CF%83%CE%B5-%CE%B5%CF%85%CF%80%CE%B1%CE%B8%CE%B5%CE%AF%CF%82-%CE%BF%CE%BC%CE%AC%CE%B4%CE%B5%CF%82-%CE%B5%CE%BD%CE%AC%CE%BD%CF%84%CE%B9%CE%B1-%CF%83%CF%84%CE%BF%CE%BD-Covid-19-101106411539049/", "Περιγραφή": "Για 4η συνεχόμενη εβδομάδα συνεχίζεται η καμπάνια συλλογής ειδών ανάγκης για τις ευπαθείς ομάδες. Η στήριξη όλων είναι κομβική σε αυτή τη δύσκολη χρονική περίοδο με oπoιo τρόπο μπορεί o καθένας, ακόμα και ένα σαπούνι ή μία συσκευασία μακαρόνια θα συμβάλει καθοριστικά στην προσπάθεια που γίνεται για την στήριξη αυτών που έχουν ανάγκη. Είναι η αλληλεγγύη στη πιο κρίσιμη μορφή της και στην πιο κρίσιμη στιγμή εκδήλωσης της.

Από Δευτέρα 13 Απριλίου και κάθε μέρα μέχρι την Κυριακή, ώρες 16:00-18:00 θα μπορέσετε να βρείτε την ομάδα στο χώρο του αυτοδιαχειριζόμενου στεκιού Καλλιθέας Buena Vista, όπου θα υπάρχουν εξωτερικά καλάθια για τα είδη ανάγκης για να τηρηθούν τα αναγκαία μέτρα αυτοπροστασίας. 

Τα είδη που χρειάζονται είναι: Σαπούνια, Αντισηπτικά, Σαμπουάν, Μαντηλάκια, τρόφιμα μακριάς διαρκείας, φρέσκα προϊόντα, τροφές για αδέσποτα ζωάκια.", "Φορέας": "Ομάδα αλληλοβοήθειας σε ευπαθείς ομάδες ενάντια στον Covid-19"}
